var maximumGain = function (s, x, y) {
    let res = 0
    let arr = s.split('')
    let findex, lastindex, fs, ls;

    if (x > y) {
        findex = x;
        lastindex = y;
        fs = 'ab';
        ls = 'ba';
    } else {
        findex = y;
        lastindex = x;
        fs = 'ba';
        ls = 'ab';
    }

    for (let i = arr.length - 1; i > 0; i--) {
        if (arr[i - 1] + arr[i] == fs) {
            arr.splice(i - 1, 2)
            i = arr.length
            res += findex

        }

    }
    for (let j = arr.length - 1; j > 0; j--) {
        if (arr[j - 1] + arr[j] == ls) {
            arr.splice(j - 1, 2)
            j = arr.length
            res += lastindex
        }
    }
    return res

};
